function removeDuplicateLetters(str) {
    let stack = [], lastOccurrence = {}, count = {};
    for (let i = 0; i < str.length; i++) {
        lastOccurrence[str[i]] = i;
    }
    for (let i = 0; i < str.length; i++) {
        const currChar = str[i];
        if (count[currChar]) continue;
        while (stack.length && stack[stack.length - 1] > currChar && lastOccurrence[stack[stack.length - 1]] > i) {
            count[stack.pop()]--;
        }
        stack.push(currChar);
        count[currChar] = 1;
    }
    return stack.join('');
}
